import { getHeroeById } from "./bases/08_imp_exp";

const promesa = new Promise((resolve, reject)=> {
    setTimeout(()=>{
        const heroe = getHeroeById(2)
        resolve(heroe);
    }, 2000)
});

promesa.then((hero)=>{
    console.log('Héroe ', hero)
})
